import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import {
  Container,
  Paper,
  Typography,
  TextField,
  Button,
  Box,
  FormControl,
  InputLabel,
  Select,
  MenuItem,
  Alert,
  CircularProgress
} from '@mui/material';
import { notificationService } from '../../services/notification.service';

export const CreateNotification: React.FC = () => {
  const navigate = useNavigate();
  const [title, setTitle] = useState('');
  const [content, setContent] = useState('');
  const [type, setType] = useState('general');
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');

  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault();
    setLoading(true);
    setError('');
    setSuccess('');

    try {
      await notificationService.createNotification({
        title,
        content,
        type
      });

      setSuccess('Thông báo đã được tạo thành công');
      // Reset form
      setTitle('');
      setContent('');
      setType('general');
    } catch (err: any) {
      setError(err.response?.data?.message || 'Có lỗi xảy ra khi tạo thông báo');
    } finally {
      setLoading(false);
    }
  };

  return (
    <Container maxWidth="lg">
      <Paper sx={{ p: 4, mt: 4 }}>
        <Box display="flex" justifyContent="space-between" alignItems="center" mb={3}>
          <Typography variant="h4" gutterBottom>
            Tạo Thông Báo Mới
          </Typography>
          <Button variant="contained" onClick={() => navigate('/admin')} color="inherit">
            Quay lại
          </Button>
        </Box>

        {error && (
          <Alert severity="error" sx={{ mb: 2 }}>
            {error}
          </Alert>
        )}

        {success && (
          <Alert severity="success" sx={{ mb: 2 }}>
            {success}
          </Alert>
        )}

        <form onSubmit={handleSubmit}>
          <FormControl fullWidth sx={{ mb: 3 }}>
            <InputLabel id="type-label">Loại thông báo</InputLabel>
            <Select
              labelId="type-label"
              value={type}
              label="Loại thông báo"
              onChange={(e) => setType(e.target.value)}
              required
            >
              <MenuItem value="general">Thông báo chung</MenuItem>
              <MenuItem value="maintenance">Bảo trì</MenuItem>
              <MenuItem value="event">Sự kiện</MenuItem>
              <MenuItem value="important">Quan trọng</MenuItem>
            </Select>
          </FormControl>

          <TextField
            fullWidth
            label="Tiêu đề thông báo"
            value={title}
            onChange={(e) => setTitle(e.target.value)}
            required
            sx={{ mb: 3 }}
          />

          <TextField
            fullWidth
            label="Nội dung thông báo"
            value={content}
            onChange={(e) => setContent(e.target.value)}
            required
            multiline
            rows={4}
            sx={{ mb: 3 }}
          />

          <Box display="flex" justifyContent="flex-end" gap={2}>
            <Button
              type="button"
              variant="outlined"
              onClick={() => {
                setTitle('');
                setContent('');
                setType('general');
              }}
              disabled={loading}
            >
              Xóa form
            </Button>
            <Button
              type="submit"
              variant="contained"
              disabled={loading}
            >
              {loading ? <CircularProgress size={24} /> : 'Tạo thông báo'}
            </Button>
          </Box>
        </form>
      </Paper>
    </Container>
  );
};
